import { styled } from "styled-components";

const CustomModal = () => {
  return (
    <StCustomModalWrapper>
      <div></div>
    </StCustomModalWrapper>
  );
};
const StCustomModalWrapper = styled.div`
  height: 100%;
  width: 100%;
  display: flex;
  margin: auto;
  position: fixed;
  background-color: rgba(0, 0, 0, 0.5);
  z-index: 10;
`;

const StCustomModalContentWrapper = styled.div`
  width: 500px;
  height: 300px;
`;

export default CustomModal;
